import express from 'express'; 
import morgan from 'morgan'; 
import cors from 'cors'; 
import path from 'path';

const app = express();
//CONEXION A BD
const mongoose = require('mongoose'); 
//const uri = 'mongodb://localhost:27017/myapp1';
const uri = 'mongodb+srv://Ferney_Toledo:FerneyToledo@atomhurondb.qbzv6.mongodb.net/myFirstDatabase?retryWrites=true&w=majority';
const options = {useNewUrlParser: true, useUnifiedTopology: true};
mongoose.connect(uri, options).then(
    () => { console.log('Conectado a DB') },
    err => { console.log(err) }
    );

//middleware
app.use(morgan('tiny'));
app.use(cors());
app.use(express.json());
//application/x-www-form-urlencoded 
app.use(express.urlencoded({ extended: true }))

//Rutas
app.use('/api', require('./routes/ambiente'));
app.use('/api', require('./routes/usuario'));
app.use('/api', require('./routes/servidor'));

// Middleware para Vue.js router modo history 
const history = require('connect-history-api-fallback'); 
app.use(history()); 
app.use(express.static(path.join(__dirname, 'public')));

//Puerto
app.set('puerto', process.env.PORT || 3000); 
app.listen(app.get('puerto'), function () { console.log('Example app listening on port'+ app.get('puerto')); });

